import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './a'

export default function AccountList() {
    const [accounts, setAccounts] = useState([]);

    useEffect(() => {
        const userId = 1;
        axios.get(`http://localhost:8080/users/${userId}/accounts`)
        .then(response => setAccounts(response.data))
        .catch(error => console.error('There was an error fetching the accouints.', error));
    }, []);

    return (<>
        <div>
            <h1>Account List</h1>
            <ul>
                {accounts.map(account => (
                    <li key={account.accountId}>{account.accountName} - ${account.balance} - {account.accountType} - {account.creditLimit} - {account.apr}% - {account.principal} - {account.loanDisbursementDate} - {account.loanRepaymentDate} - {account.minMonthlyPayment} - {account.transactions}</li>
                ))}
            </ul>
        </div>
    </>);
}
